		new Landmark { Id = 32, Name = "Mausoleum of Aga Khan", Description = "The Mausoleum of Aga Khan is the mausoleum of Aga Khan III, Sir Sultan Muhammed Shah, who died in 1957. The mausoleum is located at Aswan along the Nile of Egypt, since Egypt was formerly the centre of power of the Fatimids, an Ismaili Shia dynasty. The construction of the mausoleum began in 1956 and ended in 1960. The Aga Khan's wife, Begum Om Habibeh Aga Khan, commissioned the construction of the mausoleum, which initially accepted tourists inside; however, the interior was closed off to the public in 1997. A red rose is laid on the Aga Khan's tomb every day – a practice first started by Begum Om Habibeh Aga Khan"
		, OpenTime = TimeOnly.Parse("06:00:00"), CloseTime = TimeOnly.Parse("17:00:00"), Latitude = 24.0883699716925, Longitude = 32.878967307253, EgyptianTicketPrice = 0.0m, EgyptianStudentTicketPrice = 0.0m, ForeignTicketPrice = 0.0m, ForeignStudentTicketPrice = 0.0m },
		new Landmark { Id = 33, Name = "Bibliotheca Alexandrina", Description = "The Bibliotheca Alexandrina is a major library and cultural center on the shore of the Mediterranean Sea in Alexandria, Egypt. It is a commemoration of the Library of Alexandria, once one of the largest libraries worldwide, which was lost in antiquity. The idea of reviving the old library dates back to 1974 when a committee set up by Alexandria University selected a plot of land for its new library. Construction work began in 1995, and after some US$220 million had been spent, the complex was officially inaugurated on 16 October 2002. In 2009, the library received a donation of 500,000 books from the Bibliothèque nationale de France (BnF). The gift makes the Bibliotheca Alexandrina the sixth-largest Francophone library in the world."
		, OpenTime = TimeOnly.Parse("10:00:00"), CloseTime = TimeOnly.Parse("19:00:00"), Latitude = 31.2091371671431, Longitude = 29.9091586961897, EgyptianTicketPrice = 10.0m, EgyptianStudentTicketPrice = 5.0m, ForeignTicketPrice = 150.0m, ForeignStudentTicketPrice = 75.0m },
		new Landmark { Id = 34, Name = "Ramesseum", Description = "The Ramesseum is the memorial temple (or mortuary temple) of Pharaoh Ramesses II (\"Ramesses the Great\", also spelled \"Ramses\" and \"Rameses\"). It is located in the Theban Necropolis in Upper Egypt, on the west of the River Nile, across from the modern city of Luxor. The name – or at least its French form Rhamesséion – was coined by Jean-François Champollion, who visited the ruins of the site in 1829 and first identified the hieroglyphs making up Ramesses's names and titles on the walls. It was originally called the House of millions of years of Usermaatra-setepenra that unites with Thebes-the-city in the domain of Amon. Usermaatra-setepenra was the prenomen of Ramesses II."
		, OpenTime = TimeOnly.Parse("06:00:00"), CloseTime = TimeOnly.Parse("18:00:00"), Latitude = 25.7282800502308, Longitude = 32.610383357213, EgyptianTicketPrice = 20.0m, EgyptianStudentTicketPrice = 10.0m, ForeignTicketPrice = 180.0m, ForeignStudentTicketPrice = 90.0m },
		new Landmark { Id = 35, Name = "Egyptian Pyramids", Description = "The Pyramids of Egypt are iconic ancient structures located on the outskirts of Cairo. They include the famous pyramids of Giza, such as the Great Pyramid of Khufu, Khafre Pyramid, and Menkaure Pyramid. Built as tombs for the pharaohs during the Old Kingdom period, they stand as a testament to the engineering and architectural prowess of ancient Egypt. The pyramids are surrounded by a vast necropolis and are accompanied by the Sphinx, a mythical creature with the head of a human and the body of a lion. The pyramids continue to captivate visitors from around the world, representing the enduring legacy of ancient Egyptian civilization."
		, OpenTime = TimeOnly.Parse("07:00:00"), CloseTime = TimeOnly.Parse("17:00:00"), Latitude = 29.9773526011136, Longitude = 31.1324969342758, EgyptianTicketPrice = 60.0m, EgyptianStudentTicketPrice = 30.0m, ForeignTicketPrice = 540.0m, ForeignStudentTicketPrice = 270.0m },
		new Landmark { Id = 36, Name = "Citadel of Qaitbay", Description = "Qaitbay Castle, located in Alexandria, Egypt, is a historic fortress situated on the Mediterranean coastline. Built in the 15th century, it was commissioned by Sultan Al-Ashraf Qaitbay as a defensive stronghold against potential invaders. The castle boasts impressive architectural features, including sturdy walls, towers, and a central courtyard. It offers panoramic views of the sea and the city of Alexandria. Qaitbay Castle stands as a testament to Egypt's maritime history and is a popular tourist attraction, providing visitors with a glimpse into the region's rich architectural and military heritage."
		, OpenTime = TimeOnly.Parse("09:00:00"), CloseTime = TimeOnly.Parse("20:00:00"), Latitude = 31.2140231809782, Longitude = 29.8856336788075, EgyptianTicketPrice = 60.0m, EgyptianStudentTicketPrice = 30.0m, ForeignTicketPrice = 150.0m, ForeignStudentTicketPrice = 75.0m },
		new Landmark { Id = 37, Name = "Qasr El Nile", Description = "Qasr El-Nil is a historic district located in Cairo, Egypt, along the banks of the Nile River. It is known for its significant role in Egyptian history and as a hub for cultural and political activities. The district is home to notable landmarks such as Tahrir Square and the Egyptian Museum. Qasr El-Nil is a vibrant area with bustling streets, shops, cafes, and restaurants. It serves as a gathering place for locals and visitors alike, offering a lively atmosphere and glimpses into the city's past and present."
		, OpenTime = TimeOnly.Parse("09:00:00"), CloseTime = TimeOnly.Parse("9:00:00"), Latitude = 30.0440570213929, Longitude = 31.2316286623026, EgyptianTicketPrice = 0.0m, EgyptianStudentTicketPrice = 0.0m, ForeignTicketPrice = 0.0m, ForeignStudentTicketPrice = 0.0m },
		new Landmark { Id = 38, Name = "Saint George Church in Coptic Cairo", Description = "The Church of St. George is a Greek Orthodox church within the Babylon Fortress in Coptic Cairo. It is part of the Holy Patriarchal Monastery of St George under the Greek Orthodox Patriarchate of Alexandria and all Africa. The church dates back to the 10th century (or earlier). The current structure was rebuilt following a 1904 fire, construction was finished in 1909. Since 2009, the monastery's hegumen has had the rank of bishop with title Bishop Babylonos (\"Bishop of Babylon\")."
		, OpenTime = TimeOnly.Parse("09:00:00"), CloseTime = TimeOnly.Parse("17:00:00"), Latitude = 30.0063419904093, Longitude = 31.2301201097091, EgyptianTicketPrice = 0.0m, EgyptianStudentTicketPrice = 0.0m, ForeignTicketPrice = 0.0m, ForeignStudentTicketPrice = 0.0m },
		new Landmark { Id = 39, Name = "Saint Catherine", Description = "St. Catherine's Monastery is a historic Christian monastery located at the foot of Mount Sinai in the Sinai Peninsula, Egypt. It is one of the oldest working monasteries in the world, dating back to the 6th century. The monastery is known for housing the Burning Bush, a significant biblical site. It features ancient religious manuscripts, icons, and a library with a vast collection of rare books. St. Catherine's Monastery attracts pilgrims and tourists, offering a glimpse into the rich religious and cultural heritage of the region."
		, OpenTime = TimeOnly.Parse("08:45:00"), CloseTime = TimeOnly.Parse("23:30:00"), Latitude = 28.5559955135227, Longitude = 33.9760533662663, EgyptianTicketPrice = 0.0m, EgyptianStudentTicketPrice = 0.0m, ForeignTicketPrice = 0.0m, ForeignStudentTicketPrice = 0.0m },
		new Landmark { Id = 40, Name = "Saqqara", Description = "The Saqqara Pyramid, also known as the Step Pyramid of Djoser, is an ancient Egyptian pyramid located in Saqqara, near Cairo, Egypt. It was built during the 27th century BCE and is considered one of the earliest colossal stone structures in Egypt. Designed by the architect Imhotep, the pyramid consists of six layers or steps, giving it a unique appearance. Saqqara Pyramid marks a significant transition in pyramid construction from simple mastabas to grand pyramids. It stands as a remarkable testament to the architectural achievements of ancient Egypt and attracts visitors interested in exploring its historical and archaeological significance."
		, OpenTime = TimeOnly.Parse("08:00:00"), CloseTime = TimeOnly.Parse("17:00:00"), Latitude = 29.8684952215052, Longitude = 31.2168273532153, EgyptianTicketPrice = 30.0m, EgyptianStudentTicketPrice = 10.0m, ForeignTicketPrice = 450.0m, ForeignStudentTicketPrice = 230.0m },
		new Landmark { Id = 41, Name = "Sphinx", Description = "The Great Sphinx is an iconic statue located in Giza, Egypt, near the pyramids. It is a colossal sculpture with the body of a lion and the head of a human, believed to represent the pharaoh Khafre. The Sphinx stands at approximately 73 meters long and 20 meters tall. It is shrouded in mystery and has captivated people for centuries with its enigmatic expression and symbolism. The Great Sphinx is a UNESCO World Heritage Site and remains a symbol of ancient Egypt's grandeur and architectural achievements."
		, OpenTime = TimeOnly.Parse("08:00:00"), CloseTime = TimeOnly.Parse("17:00:00"), Latitude = 29.9752739473739, Longitude = 31.1375672655896, EgyptianTicketPrice = 80.0m, EgyptianStudentTicketPrice = 40.0m, ForeignTicketPrice = 400.0m, ForeignStudentTicketPrice = 200.0m },
		new Landmark { Id = 42, Name = "Mosque-Madrasa of Sultan Hassan", Description = "The Sultan Hassan Mosque is a historic mosque located in Cairo, Egypt. It was built in the 14th century during the Mamluk period by Sultan Hassan. The mosque showcases impressive Mamluk architecture, featuring soaring minarets, grand domes, and intricate stone carvings. It includes a large prayer hall, a courtyard, and a mausoleum. The Sultan Hassan Mosque is known for its monumental size and elegant design, making it one of the most prominent mosques in Cairo. It stands as a testament to the rich architectural heritage of Islamic Egypt and is a significant cultural and religious site."
		, OpenTime = TimeOnly.Parse("09:00:00"), CloseTime = TimeOnly.Parse("17:00:00"), Latitude = 30.0322828652592, Longitude = 31.2561733928027, EgyptianTicketPrice = 0.0m, EgyptianStudentTicketPrice = 0.0m, ForeignTicketPrice = 180.0m, ForeignStudentTicketPrice = 90.0m },
		new Landmark { Id = 43, Name = "Roman Amphitheatre in Alexandria", Description = "The Roman amphitheatre of Alexandria, also known as the Kom El Dikka amphitheatre, is an ancient Roman amphitheatre located in Alexandria, Egypt. It dates back to the 2nd century CE and was once part of a larger complex that included baths and a lecture hall. The amphitheatre could seat around 800 spectators and was used for various performances and events. Today, it stands as a remarkable archaeological site, with remnants of its seating, stage, and corridors still visible. The Roman amphitheatre of Alexandria offers a glimpse into the Roman influence on the city's history and cultural life."
		, OpenTime = TimeOnly.Parse("09:00:00"), CloseTime = TimeOnly.Parse("17:00:00"), Latitude = 31.1946531754572, Longitude = 29.9040279377077, EgyptianTicketPrice = 20.0m, EgyptianStudentTicketPrice = 10.0m, ForeignTicketPrice = 150.0m, ForeignStudentTicketPrice = 75.0m },
		new Landmark { Id = 45, Name = "Valley of the Kings", Description = "The Valley of the Kings is an archaeological site located near Luxor, Egypt. It served as the burial ground for pharaohs and powerful nobles during the New Kingdom period. The valley contains over 60 tombs, including the famous tomb of Tutankhamun. The tombs are adorned with intricate wall paintings and hieroglyphic inscriptions. The Valley of the Kings is a UNESCO World Heritage Site and offers visitors a unique opportunity to explore the royal tombs and gain insights into ancient Egyptian funerary practices and beliefs."
		, OpenTime = TimeOnly.Parse("06:00:00"), CloseTime = TimeOnly.Parse("17:00:00"), Latitude = 25.7401753467689, Longitude = 32.6014106047363, EgyptianTicketPrice = 60.0m, EgyptianStudentTicketPrice = 30.0m, ForeignTicketPrice = 600.0m, ForeignStudentTicketPrice = 300.0m },
		new Landmark { Id = 46, Name = "White Desert", Description = "The White Desert, also known as the Sahara el Beyda, is a mesmerizing natural wonder located in Egypt's Western Desert. It is characterized by surreal white rock formations shaped by erosion over millions of years. The landscape resembles a dream-like desert with unique formations resembling mushrooms, pillars, and other fascinating shapes. The White Desert is a popular destination for camping and stargazing, offering visitors a chance to witness the stark beauty of the desert under the moonlight. It is a remarkable testament to the incredible geological diversity found in Egypt's deserts."
		, OpenTime = TimeOnly.Parse("09:00:00"), CloseTime = TimeOnly.Parse("09:00:00"), Latitude = 27.3640559541607, Longitude = 28.1219488191139, EgyptianTicketPrice = 0.0m, EgyptianStudentTicketPrice = 0.0m, ForeignTicketPrice = 0.0m, ForeignStudentTicketPrice = 0.0m },
		new Landmark { Id = 47, Name = "Kalabsha Temple", Description = "Kalabsha Temple, also known as the Temple of Mandulis, is an ancient Egyptian temple located near Aswan, Egypt. It was constructed during the Roman period and is dedicated to the Nubian sun god Mandulis. The temple features well-preserved reliefs and carvings depicting various deities and pharaohs. It showcases a traditional Egyptian architectural style with pylons, a hypostyle hall, and a sanctuary. Kalabsha Temple is a popular tourist attraction, offering visitors a chance to explore the history and religious practices of ancient Egypt in the southern region."
		, OpenTime = TimeOnly.Parse("07:00:00"), CloseTime = TimeOnly.Parse("16:00:00"), Latitude = 23.9609409409204, Longitude = 32.8674082016913, EgyptianTicketPrice = 10.0m, EgyptianStudentTicketPrice = 5.0m, ForeignTicketPrice = 150.0m, ForeignStudentTicketPrice = 75.0m }
         );

